import React, { useEffect } from "react";
import Card from '../UI/Card';


const Maps = () => {
  return (

    <Card>
    <div>
        <script src="mapscipt.js"></script>
        <div className ="maps">
        <div className = "topMap">
            <div id="map1"></div>
            <div id="map2"></div>
            <div id="map3"></div>
        </div>
        <div className = "botMap">
            <div id="map4"></div>
        </div>
        </div>
    </div>
    </Card>

  );
};

export default Maps;
